                    Large button
          </Button>
            </div>
            <br />
            <div className={classes.root}>
                <Button variant="primary" size="sm" >
                    Small button
          </Button>{' '}
                <Button variant="secondary" size="sm">
                    Small button
          </Button>
                <img src={logo} alt="kaffesnurr.se" height="25px" className={classes.image} /> Kaffesnurr.se
